import React from "react";

function ExpenseStatistic(props) {
  const month = props.data.map((value) => {
    return value.date.slice(5, 7);
  });
  
  // const statistic =  props.data.map((value) => {
  //   return value.amount;
  // });

  // const getClassName = document.querySelectorAll('.slideBar')
  // const changeHeight = () => { 
  //   getClassName.style.setProperty('--value', '50%')
  // }

  
  return (
    <div
      style={{
        display: "flex",
        margin: "15px",
        marginBottom: 5,
        backgroundColor: "#f7dbfa",
        width: "95%",
        height: 180,
        borderRadius: 15,
        alignItems: "center",

      }}
    >
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      >
        <div
        className={month.includes} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('01') ? "100%" : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Jan
        </b>
      </div>
      <div
       
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div
      className={month.includes} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('02') ? "100%" : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Feb
        </b>
      </div>
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div
      className={month.includes} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('03') ? "100%" : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Mar
        </b>
      </div>
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div
      className={month.includes} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('04') ? "100%" : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
